            <g transform="translate(25 0)">
                <text transform="translate(1031.33 388)"
                      style="font-size:36px;fill:#67c3c4;font-family:MicrosoftYaHei-Bold, Microsoft YaHei;font-weight:700">
                    The Last Mile
                    <tspan style="font-size:18px;fill:#fff;font-family:MicrosoftYaHei, Microsoft YaHei;font-weight:400">
                        <tspan x="0" y="56">On January 23, the lockdown was implemented, and the logistics and transpor-</tspan>
                        <tspan x="0" y="84">tation in Wuhan just ran out of their original order.</tspan>
                        <tspan x="0" y="140">On January 24, the Chinese New Year's Eve, Wuhan lost bustle, with medicals</tspan>
                        <tspan x="0" y="168">supplies and daily necessities being undersupplied.</tspan>
                        <tspan x="0" y="224">On January 25, the government took a series of initiatives to support emergen-</tspan>
                        <tspan x="0" y="252">cy logistics. And it started a constant stream of supplies to Wuhan. </tspan>
                        <tspan x="0" y="308">But at that point the delivery of supplies to civilians, was stalled in the last mile...
</tspan>
 <tspan x="0" y="364">A large number of expressmen gave up their positions, nearly 2/3 of express</tspan>
 <tspan x="0" y="392">stations had to be closed. The logistical hurdles were unprecedented.</tspan>
                    </tspan>
                </text>
                <text id="carText" opacity="0" transform="translate(1031.33 388)"
                      style="font-size:16px;fill:#fff;font-family:MicrosoftYaHei, Microsoft YaHei">
                    <tspan style="font-size:18px;fill:#fff;font-family:MicrosoftYaHei, Microsoft YaHei;font-weight:400">
                        <tspan x="0" y="448">Food delivery drivers, bus drivers, security guards, sellers, and others took up</tspan>
                        <tspan x="0" y="476">the baton of the delivery man.  The ordinary city residents volunteered to deliv-</tspan>
                        <tspan x="0" y="504">er the supplies and services in the last mile.</tspan>
                    </tspan>
                </text>
